pragma solidity >=0.8.0 <0.9.0;
import "@chainlink/contracts/src/v0.8/shared/interfaces/AggregatorV3Interface.sol";

library PriceConverter {

    address public constant ETH_USD_ADDRESS =  0x694AA1769357215DE4FAC081bf1f309aDC325306;
    uint256 public constant TOKEN_DECIMALS = 10**18;

    function getPrice() internal view returns (uint256) {

        AggregatorV3Interface priceFeed = AggregatorV3Interface(ETH_USD_ADDRESS);
       (,int256 price,,,) = priceFeed.latestRoundData();
        return uint256(price * 1e10);
    } 

    function getVersion() internal view returns (uint256) {
        AggregatorV3Interface priceFeed = AggregatorV3Interface(ETH_USD_ADDRESS);   
        return priceFeed.version();
    }

    function getConversioRate(uint256 ethAmount) internal view returns (uint256) {
        uint256 ethPrice = getPrice();
        uint256 ethAmountInUsd = (ethAmount * ethPrice)/TOKEN_DECIMALS;
        return ethAmountInUsd;
    }
}

