//SPDX-License-Identifier: MIT
pragma solidity >=0.8.0 <0.9.0;

import "hardhat/console.sol";
import "@openzeppelin/contracts/access/Ownable.sol";
import "./PriceConverter.sol";

// I am building a community pool saving
contract YourContract {
    using PriceConverter for uint256;
    // constant
    address immutable public ETH_USD_ADDRESS =  0x694AA1769357215DE4FAC081bf1f309aDC325306;

    uint256 public constant TOKEN_DECIMALS = 10**18;

    // state variables
    address public immutable creator;


    string public equbTitle;
    uint256 public immutable creationTime = block.timestamp;

    uint256 public poolAmount;
    uint256 public individualContribution;

    uint256 public currentCycle;
    uint256 public totalCycles;
    uint256 public cycleDuration;

    address[] public members;
    address[] public currentMembers; 

    address public luckyWinner;  

    // mapping
    mapping(address => uint256) public memberContribution;

    // events
    event MemberJoined(address indexed member, uint256 contribution);
    event MemberWithdrawn(address indexed member, uint256 amount);


    constructor(address _creator, string memory _equbTitle, uint256 _poolAmount,  uint256 _totalCycles, uint256 _cycleDuration) {
        creator = _creator;
        luckyWinner = _creator;
        equbTitle = _equbTitle;
        poolAmount = _poolAmount;
        individualContribution = _poolAmount / _totalCycles;
        totalCycles = _totalCycles;
        cycleDuration = _cycleDuration;
        currentCycle = 0;
    }


    modifier isLuckyWinner() {
        require(msg.sender == luckyWinner, "Not the lucky winner");
        _;
    }

    function getBalance(address _account) public view returns (uint256) {
        return _account.balance;
    }

    function joinEqub() public payable {

        require(members.length < totalCycles, "Equb is full");
        require(getBalance(msg.sender) >= individualContribution, "Insufficient balance");
        // send individual contribution to the contract
        (bool success, ) = address(this).call{value: individualContribution}("");
        require(success, "Failed to send Ether");

        members.push(msg.sender);
        currentMembers.push(msg.sender);
        memberContribution[msg.sender] += individualContribution;

        // emit: keyword used to trigger an event
        emit MemberJoined(msg.sender, individualContribution);
    }

    function seePrice() public view returns (uint256) {
        return PriceConverter.getPrice();
    }

    function withdraw() public isLuckyWinner() {

        uint256 balance = address(this).balance;

        if (balance > individualContribution * members.length) {
            balance = individualContribution * members.length;
        }

        (bool success, ) = luckyWinner.call{ value: balance}("");
         require(success, "Failed to send Ether");

         // reset the lucky winner
        luckyWinner = address(0);
        // increment the current cycle
        currentCycle++;
        // remove lucky winner from the current members
        for (uint256 i = 0; i < currentMembers.length; i++) {
            if (currentMembers[i] == luckyWinner) {
                delete currentMembers[i];
            }
        }

        // emit: keyword used to trigger an event
        emit MemberWithdrawn(luckyWinner, address(this).balance);
    }

    /**
     * Function that allows the contract to receive ETH
     */
    receive() external payable {}
}

