//SPDX-License-Identifier: MIT
pragma solidity >=0.8.0 <0.9.0;

import "hardhat/console.sol";
import "@openzeppelin/contracts/access/Ownable.sol";
import "./YourContract.sol";


contract YourContractFactory {

    YourContract[] public yourContractArray;

    function createYourContract(string memory _equbTitle, uint256 _poolAmount, uint256 _totalCycles, uint256 _cycleDuration) public {
        YourContract yourContract = new YourContract(msg.sender, _equbTitle, _poolAmount, _totalCycles, _cycleDuration);
        yourContractArray.push(yourContract);
    }

    function yourContractStore(uint256 _yourContractIndex) public view returns (YourContract) {
        YourContract yourContract = yourContractArray[_yourContractIndex];
        return yourContract;
    }

     function yourContractGet(uint256 _yourContractIndex) public view returns (YourContract) {
        YourContract yourContract = yourContractArray[_yourContractIndex];
        return yourContract;
    }

    function getDeployedContracts() public view returns (YourContract[] memory)  {
        return yourContractArray;
    }
}

